import React from "react";
import { Link, Router } from "react-router-dom";

import "./Nav.css"

function Nav() {

    return(
        <nav className="main-nav">
            <Link to="/">ABOUT</Link>
            <Link to="/projects/">PORTFOLIO</Link>
            <Link to="/contact-us/">CONTACT</Link>
        </nav>
    );
}

export default Nav;
